DROP TABLE IF EXISTS `chatgpt_user`;
CREATE TABLE `chatgpt_user`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `token` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '密钥',
  `surplus` int(10) NULL DEFAULT 0 COMMENT '剩余聊天条数',
  `create_date` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_date` datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `use_num` int(11) NULL DEFAULT 0 COMMENT '已经使用次数',
  `type` tinyint(2) NULL DEFAULT NULL COMMENT '类型 默认0，购买次数。1，按月购买',
  `start_date` datetime(0) NULL DEFAULT NULL COMMENT '启用时间=如果这个值为空，则第一次放入',
  `long_date` int(11) NULL DEFAULT NULL COMMENT '有效时间 1个月，3个月，6个月，1年，永久=0',
  `express_date` datetime(0) NULL DEFAULT NULL COMMENT '过期时间=启用时间，计算',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `token`(`token`) USING BTREE COMMENT 'token唯一'
) ENGINE = InnoDB AUTO_INCREMENT = 504 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

