INSERT INTO `chatgpt_question_log` VALUES (415, '背景：在今日的季后赛首轮中，国王主场126-123力克勇士，系列赛1-0领先。\n\n迪文琴佐和克雷各中三分，国王则是连续篮下杀伤。克雷又是连续上篮，库里三分命中后勇士领先5分。萨博尼斯和许尔特回应上篮，勇士也连续篮下得分。米切尔和莱尔斯各中三分后国王反超比分，但普尔卢尼维金斯都得分。莱尔斯又中三分，节末福克斯连续得分，首节双方打成29平。\n\n第二节普尔连得5分、库明加暴扣得分，莱恩则是连续吃饼。佩顿和普尔篮下取分后蒙克连续突破得分。库里和普尔各中三分后库里中投得分，勇士领先了5分。汤普森还中三分，但蒙克又是连续砍分。维金斯连得6分帮助勇士保持领先，半场以61-55领先6分。\n\n易边再战库里迪文琴佐和卢尼都得分，勇士领先了10分。福克斯发力连得11分，但克雷也连续得分。巴恩斯许尔特得分后分差只剩4分，维金斯又回应三分和中投，库里三分也进后分差再次回到10分。但随后莱尔斯成为奇兵，补扣、三分、补篮，福克斯三分命中后莱尔斯再中三分，节末蒙克又是突破得分。国王在节末最后3分钟打出一波15-4，三节过后以91-90领先1分。\n\n第四节福克斯和蒙克各中三分，分差达到5分。迪文琴佐三分止血、库明加2+1，库里三分也进后勇士反超2分。蒙克和巴恩斯篮下得分夺回领先，汤普森又回应三分，最后5分钟勇士领先1分。福克斯三分回应，克雷又中三分。蒙克罚球得分后库里三分也进，但马上福克斯又回应三分，蒙克萨博尼斯各得分，巴恩斯再中三分，最后2分半国王领先了6分。\n\n库里上篮、三分命中随后又是上篮得分，最后47秒分差只剩1分。福克斯连续两次出手不中，但维金斯空位三分也不进，最后5秒萨博尼斯篮板拿下，勇士只得犯规。蒙克两罚全中，最后3秒勇士落后3分。库里压哨三分不中，比赛结束。\n\n勇士队：库里30分6篮板5失误，汤普森21分6篮板5助攻，德雷蒙德-格林5投1中，得到4分9篮板11助攻2抢断，迪文琴佐10分，卢尼8分9篮板，维金斯17分，普尔17分。\n\n国王队：福克斯38分5助攻3抢断，萨博尼斯12分16篮板3抢断，巴恩斯13分7篮板，蒙克32分，莱尔斯16分6篮板。\n\n请按照以上背景编辑一个非常吸引人的文案', 0, 'kUUVS8sBEDi8Tbytkti5PgqjE8B62UxE', '2023-04-16 18:58:40', NULL);
